import react from 'react'

function Card(){

    let products = {
        "soda":[
            "pepsi",
            "coke",
            "7up"
        ]
    }
    return(
        <div>
            <h1>Products</h1>
            <ul>
                {products.soda.map((product, index) => {
                    return <li className='product-card' key={index}>{product}</li>
                })}
            </ul>
        </div>
    )
}


export default Card
